import React from 'react'
import styled from 'styled-components'

const SideBar = styled.div`
  position: absolute;  
  width: 17em;
  height: 100%;
  top: 0;
  overflow:hidden;
  background-color: #19222a;
  -webkit-transform: translateZ(0);
  visibility: visible;
  -webkit-backface-visibility: hidden;
`
const Link = styled.a`
    color:#ffffff ;
    size:24px ;
`

const LinksSection = styled.ul`
    list-style:none;
    display: block;
    padding: 0;
    margin: 0;
`

const ListOfLinks = styled.li`
    margin-left: 0;
      padding-left: 0;
      
      display:inline-block;
      width: 100%;
`

function AdminPanel() {
    return (
        <SideBar>
            <LinksSection>
               <ListOfLinks> <Link>FOODS</Link> </ListOfLinks>
               <ListOfLinks>  <Link>ORDERS</Link> </ListOfLinks>
               <ListOfLinks>  <Link>UPLOAD FORM</Link> </ListOfLinks>
            </LinksSection>
        </SideBar>
    )
}

export default AdminPanel
